import React, {Component} from 'react';
import './Footer.css';

class Footer extends Component {
    render() {
        return(
            <footer>
                <div className="container">
                    <h3 className="">Minhas redes sociais</h3>
                    <div className="text-center center-block">
                        <a href="https://github.com/LuanColeto"><img width="50px" height="50px" className="bg-white social-icon" /></a>
                        <a href="https://www.linkedin.com/in/luan-coleto-7b8b9b180/"><img width="50px" height="50px" className="bg-white social-icon" /></a>
                        <a><img width="50px" height="50px" className="bg-white social-icon" /></a>
                    </div>
                </div>
            </footer>
        )
    }
}

export default Footer;
